def isValid(s):
    # remove duplicates from the strings
    s_set = set(s)

    # will hold the count of each character
    counts = []

    # saves the counts of the characters
    for c in s_set:
        counts.append(s.count(c))

    # will check if 1 character has been removed from 1 index
    removed_one = False
    # the current count initialize to the first element in count
    current_count = counts[0]

    for n in counts:
        # if the character occurs the same number of times
        if n == current_count:
            continue
        # if you can remove on character from one index
        elif n - 1 == current_count or n + 1 == current_count or n == 1:
            # if one character has already been removed
            if removed_one:
                return "NO"

            # set removed to true
            removed_one = True
            continue
        else:
            return "NO"

    return "YES"


print(isValid("aabbcd"))
print(isValid("aabbccddeefghi"))
print(isValid("abcdefghhgfedecba"))
print(isValid("aaaaaaaaaaaaaaaaaaab"))
print(isValid("abbbbbbbbbbbbbbbbb"))
print(isValid("abcdefghhgfedecba"))
print(isValid("abbac"))
print(isValid(""))
print(isValid(""))
